// src/pages/LandingPage.js

import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();
  const [selectedRole, setSelectedRole] = useState('');

  // Handle role selection
  const handleRoleChange = (e) => {
    setSelectedRole(e.target.value);
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Redirect to the appropriate login route based on the selected role
    if (selectedRole === 'admin') {
      navigate('/login/admin');
    } else if (selectedRole === 'chimiste') {
      navigate('/login/chimiste');
    } else if (selectedRole === 'pharma') {
      navigate('/login/pharma');
    } else if (selectedRole === 'dev') {
      navigate('/login/dev');
    } else {
      alert('Veuillez sélectionner un rôle.');
    }
  };

  return (
    <div className="container" style={styles.container}>
      {/* Header Section */}
      <div style={styles.welcomeSection}>
        <img src="/logo1.png" alt="Logo" style={styles.logo} />
        <h1 className="section-title" style={styles.title}>Bienvenue sur Quantum Drug Design</h1>
        <p style={styles.subtitle}>
          Une plateforme dédiée à la gestion des molécules, l'analyse clinique et le développement scientifique.
        </p>

        {/* Role Selection Dropdown */}
        <form onSubmit={handleSubmit} style={styles.roleForm}>
          <label htmlFor="role" style={styles.label}>
            Sélectionnez votre rôle:
          </label>
          <div style={styles.selectWrapper}>
            <select
              id="role"
              value={selectedRole}
              onChange={handleRoleChange}
              style={styles.select}
              required
            >
              <option value="">--Choisir un rôle--</option>
              <option value="admin">Administrateur</option>
              <option value="chimiste">Chimiste</option>
              <option value="pharma">Pharmacien</option>
              <option value="dev">Développeur</option>
            </select>
          </div>

          {/* Submit Button */}
          <button type="submit" className="button-primary" style={styles.connectButton}>
            Se connecter
          </button>
        </form>
      </div>

      {/* Features Section */}
      <div className="section" style={styles.featuresSection}>
        <h2 className="section-title">Nos Fonctionnalités</h2>
        <div className="content" style={styles.featureCards}>
          <div className="card" style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Authentication Multi-Rôle</h3>
            <p style={styles.featureDescription}>
              Accès sécurisé pour Admins, Chimistes, Pharmaciens et Développeurs.
            </p>
          </div>
          <div className="card" style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Visualisation 3D</h3>
            <p style={styles.featureDescription}>
              Explorez les structures moléculaires en 3D avec précision.
            </p>
          </div>
          <div className="card" style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Analyse Graphique</h3>
            <p style={styles.featureDescription}>
              Graphiques interactifs pour analyser les données scientifiques.
            </p>
          </div>
          <div className="card" style={styles.featureCard}>
            <h3 style={styles.featureHeader}>Monitoring des Modèles</h3>
            <p style={styles.featureDescription}>
              Suivez les performances des modèles IA/ML en temps réel.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

// Styles - Combined with index.css classes where appropriate
const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    minHeight: '100vh',
    backgroundColor: '#fff', // White background as requested
    padding: '20px',
    maxWidth: '100%',
    margin: '0 auto',
  },
  welcomeSection: {
    backgroundColor: '#fff', // White background as requested
    padding: '40px',
    borderRadius: '10px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    marginBottom: '40px',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    width: '100%',
    maxWidth: '800px',
  },
  logo: {
    width: '150px', // Much bigger logo as requested
    height: 'auto',
    marginBottom: '20px',
  },
  title: {
    fontSize: '2.5rem',
    fontWeight: 'bold',
    color: '#ff69b4', // Maintaining pink theme from index.css
    textAlign: 'center',
    marginBottom: '10px',
  },
  subtitle: {
    fontSize: '1.2rem',
    color: '#333',
    textAlign: 'center',
    marginTop: '10px',
    marginBottom: '20px',
  },
  roleForm: {
    display: 'flex',
    flexDirection: 'column',
    gap: '15px',
    alignItems: 'center',
    marginTop: '20px',
    width: '100%',
    maxWidth: '400px',
  },
  label: {
    fontSize: '1.1rem',
    fontWeight: 'bold',
    color: '#333',
  },
  selectWrapper: {
    position: 'relative',
    width: '100%',
  },
  select: {
    padding: '12px',
    border: '2px solid #ff69b4',
    borderRadius: '5px',
    backgroundColor: '#fff',
    fontSize: '1rem',
    cursor: 'pointer',
    width: '100%',
    appearance: 'none', // Removes default dropdown arrow
    backgroundImage: 'url("data:image/svg+xml;charset=US-ASCII,%3Csvg%20xmlns%3D%22http%3A%2F%2Fwww.w3.org%2F2000%2Fsvg%22%20width%3D%22292.4%22%20height%3D%22292.4%22%3E%3Cpath%20fill%3D%22%23FF69B4%22%20d%3D%22M287%2069.4a17.6%2017.6%200%200%200-13-5.4H18.4c-5%200-9.3%201.8-12.9%205.4A17.6%2017.6%200%200%200%200%2082.2c0%205%201.8%209.3%205.4%2012.9l128%20127.9c3.6%203.6%207.8%205.4%2012.8%205.4s9.2-1.8%2012.8-5.4L287%2095c3.5-3.5%205.4-7.8%205.4-12.8%200-5-1.9-9.2-5.5-12.8z%22%2F%3E%3C%2Fsvg%3E")',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'right 12px top 50%',
    backgroundSize: '12px auto',
  },
  connectButton: {
    padding: '14px 24px',
    backgroundColor: '#8a2be2', // Purple theme from index.css
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    fontSize: '1.1rem',
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
    marginTop: '10px',
    width: '100%',
  },
  featuresSection: {
    width: '100%',
    maxWidth: '1000px',
    padding: '20px 0',
  },
  featureCards: {
    display: 'flex',
    flexWrap: 'wrap',
    gap: '20px',
    justifyContent: 'center',
  },
  featureCard: {
    flex: '1 1 200px',
    maxWidth: '280px',
    minHeight: '200px',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
  },
  featureHeader: {
    fontSize: '1.3rem',
    fontWeight: 'bold',
    marginBottom: '15px',
    color: '#ff69b4',
    textAlign: 'center',
  },
  featureDescription: {
    fontSize: '1rem',
    color: '#333',
    lineHeight: '1.5',
    textAlign: 'center',
  },
};

export default LandingPage;
